INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1001, 1.4, 1, 2, "春咲 ひより", 0, 0, 0, "お！\nあそこに困ってそうな人発見！", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1002, 1.4, 1, 2, "草野 優衣", 0, 0, 0, "大切な人を\n守れるようになりたい…って", "みんなみたいに\nわたしも強くならなきゃ", 0, 1, "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1003, 1.4, 1, 2, "士条 怜", 0, 0, 0, "キミに必要な集中力と感性が", "フェンシングを始めてみては？", 0, 1, "少しは磨かれると思いますよ。");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1004, 1.5, 1, 2, "穂高 みそぎ", 0, 0, 0, "今日はなにして遊ぶ？", "ねぇ、にいちゃん！", 0, 1, "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1006, 1.4, 1, 2, "風宮 あかり", 0, 0, 0, "ねぇ…", "風宮あかりです", 0, 1, "私といっしょに…\nいかない？");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1007, 1.5, 1, 2, "出雲 宮子", 0, 0, 0, "プリンたべたいのー", "出雲宮子なのー", 0, 1, "食べ物の恨みは怖いのー");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1008, 1.4, 1, 2, "虹村 雪", 0, 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", "ボクは虹村雪。", 0, 1, "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1009, 1.4, 1, 2, "柊杏奈", 0, 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "フッ…聞いて後悔するがいい！", 0, 1, "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1010, 1.5, 1, 2, "姫宮 真歩", 0, 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "マホマホ王国のプリンセス、\nまほ姫どす", 0, 1, "ほんまおおきにやわ～♪");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1011, 1.4, 1, 2, "衣之咲 璃乃", 0, 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲璃乃です！", 0, 1, "ここで会ったが\n100年目～！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1012, 1.4, 1, 2, "柏崎 初音", 0, 0, 0, "ち、超能力って…\n何のことかな～？", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 1, "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1016, 1.4, 1, 2, "美波 鈴奈", 0, 0, 0, "一応カリスマ読モJKやってまっす！", "ちょす！\n美波鈴奈だよ～♪", 0, 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1017, 1.4, 1, 2, "喜屋武 香織", 0, 0, 0, "東京は遊園地みたいなところさー", "はいたーい。\n喜屋武香織さー。", 0, 1, "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1018, 1.4, 1, 2, "支倉 伊緒", 0, 0, 0, "先生って呼ばれるのは\nくすぐったいから", "支倉伊緒です。", 0, 1, "イオちゃんって呼んでね。");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1020, 1.5, 1, 2, "茜 ミミ", 0, 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 1, "ミミをおいてかないでぇ～");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1021, 1.5, 1, 2, "栗林 くるみ", 0, 0, 0, "あの……\nふぇ……", "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 1, "ふぇぇぇぇぇん……");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1022, 1.4, 1, 2, "風宮 より", 0, 0, 0, "こんな私に貴重な時間を\n割いていただき、", "風宮よりです。\nあああああ！", 0, 1, "なんてありがとうございます！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1023, 1.5, 1, 2, "北条 綾音", 0, 0, 0, "おにいちゃんどこいくの？\nえ？", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 1, "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1025, 1.4, 1, 2, "天野 すずめ", 0, 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", "わっ…わっ…私、\n天野すずめといいます！", 0, 1, "これて何か違う…\nあああすみません！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1027, 1.4, 1, 2, "倉石 恵理子", 0, 0, 0, "あなたは…運命の……\n伴侶……", "……クスクス…私は\n…倉石恵理子……", 0, 1, "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1028, 1.4, 1, 2, "佐々木 咲恋", 0, 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 1, "…そうでしょ？？");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1029, 1.4, 1, 2, "桜井 望", 0, 0, 0, "ぇっと…\nキミ、私のこと知らないの?!", "桜井望だよ！\nよろしくねっ", 0, 1, "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1030, 1.4, 1, 2, "ニノン・ジュベール", 0, 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", "デケデケデンっ！", 0, 1, "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1031, 1.4, 1, 2, "上喜 しのぶ", 0, 0, 0, "でもって私の隣にいるのが……\nえ、見えない？", "上喜しのぶです。\n手元のドクロが父です。", 0, 1, "おかしいですね……");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1033, 1.5, 1, 2, "野戸まひる", 0, 0, 0, "けんども\nそれには足りないモンが…", "目指すはビッグな\nお笑い芸人だっぺ！", 0, 1, "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1034, 1.4, 1, 2, "綾瀬 ゆかり", 0, 0, 0, "ちょっと緊張しちゃって…", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 1, "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1036, 1.5, 1, 2, "氷川 鏡華", 0, 0, 0, "知らない人とは話しちゃいけないので", "氷川鏡華…です", 0, 1, "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1038, 1.4, 1, 2, "柏崎 栞", 0, 0, 0, "……あ、アラーム。", "柏崎…栞です。", 0, 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1040, 1.4, 1, 2, "双葉 碧", 0, 0, 0, "私、一人も友達がいなくて……", "ふ、双葉碧です。", 0, 1, "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1042, 1.4, 1, 2, "三角 千歌", 0, 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角千歌です。", 0, 1, "そう思っています。");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1043, 1.4, 1, 2, "安芸 真琴", 0, 0, 0, "あぁ？\nお前のそいつの仲間か？", "安芸真琴だ。", 0, 1, "う、疑ってすまなかったな…");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1044, 1.4, 1, 2, "イリヤ・オーンスタイン", 0, 0, 0, "生けとし生ける全ての者よ！", "わらわこそは夜を総べる者！", 0, 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1045, 1.4, 1, 2, "遠見 空花", 0, 0, 0, "ぐふふふふ……はっ！", "そこで騎士は妖精を乱暴に……", 0, 1, "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1046, 1.4, 1, 2, "宮坂たまき", 0, 0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 1, "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1048, 1.4, 1, 2, "大神 美冬", 0, 0, 0, "それでは早速クエストに…", "大神美冬よ！", 0, 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1049, 1.4, 1, 2, "星野静流", 0, 0, 0, "クエストもバトルも\n掃除も洗濯も", "星野静流だよ！", 0, 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1050, 1.5, 1, 2, "玉泉美咲", 0, 0, 0, "見ての通りの\nセクシー美少女で", "アタシは玉泉美咲。", 0, 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1052, 1.4, 1, 2, "リマ", 0, 0, 0, "？？？？", "？？？", 0, 1, "？？？？");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1053, 1.5, 1, 2, "モニカ・ヴァイスヴィント", 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 0, 1, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1058, 1.5, 1, 2, "ペコリーヌ", 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 0, 1, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1059, 1.5, 1, 2, "コッコロ", 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 0, 1, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (1, 0, 1060, 1.5, 1, 2, "キャル", 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィントだ。", 0, 1, "そ、そこまでいうなら\nもらってやる");
